// 解密函数
decrypted = function (lasttime,data){
// 假设你有一个Base64编码的密文、密钥和IV
//     const ciphertextBase64 = ''
    const secretKey = w_parse(encodeURIComponent(lasttime + "000"))
    const ciphertext = CryptoJS.enc.Base64.parse(data.toString());
    const iv = secretKey
    // //
    // // // 使用AES解密
    const decrypted = CryptoJS.AES.decrypt(
      {
        ciphertext: ciphertext
      },
      secretKey,
      {
        iv: iv,
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7
      }
    );

    // 将解密后的WordArray转换为字符串
    const decryptedText = decrypted.toString(CryptoJS.enc.Utf8);
    return decryptedText
    // var base64String = CryptoJS.enc.Base64.stringify(decrypted);
    // return base64String
}

module.exports = decrypted;

